import { Button, Typography } from '@mui/material';
import '../../App.css';
import config from '../../config';

function Footer() {
  return (
    <div style={{ bottom: 0, paddingBottom: 10, width: '100%', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
        <Typography variant="span" style={{ fontFamily: 'Newsreader', color: config.colors.secondary }}>Convictions Vertes - 5 rue Gustave Simon 54000 Nancy - 2025</Typography>
    </div>
  );
}

export default Footer;
